import React from "react";
import Avatar from '@mui/material/Avatar';

import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';

import PlaceIcon from '@mui/icons-material/Place';
import EmailIcon from '@mui/icons-material/Email';
import LocalPhoneOutlinedIcon from '@mui/icons-material/LocalPhoneOutlined';
import Card from "@mui/material/Card";
import { Typography } from "@mui/material";


function ContactInfo() {
  return (
    <Card

      sx={{ alignText:"center", width: "100%", height: "400px", borderRadius: "5px", border: "2px solid white", background: "transparent"}}
      elevation={4} 
    >
      <Typography variant="h2">
        Contact Info
      </Typography>;
      <List sx={{ width: '100%', maxWidth: 360 }}>
        <ListItem>
          <ListItemAvatar>
            <Avatar>
              <PlaceIcon />
            </Avatar>
          </ListItemAvatar>
          <ListItemText primary="Av Colonial 999"  />
        </ListItem>
        <ListItem>
          <ListItemAvatar>
            <Avatar>
              <LocalPhoneOutlinedIcon />
            </Avatar>
          </ListItemAvatar>
          <ListItemText primary="+51 940780152"/>
        </ListItem>
        <ListItem>
          <ListItemAvatar>
            <Avatar>
              <EmailIcon />
            </Avatar>
          </ListItemAvatar>
          <ListItemText primary="jhonatanjcca@gmail.com" />
        </ListItem>
      </List>
    </Card>
  );
}

export default ContactInfo;
